import { SvgIcon, Typography } from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';

const StatusIcon = withStyles({
  root: {
    fontSize: '5em',
    color: 'green'
  }
})(SvgIcon);

const Text = withStyles({
  root: {
    fontSize: '1em'
  }
})(Typography);

export {
  StatusIcon,
  Text
};
